        [HttpGet]
        [RequireHttps]
        public async Task<ActionResult> ImageToVoice() {
            await saveLog();
            if (Session.Count == 0)
            {
                TempData["LogInError"] = "Session has ended. Please log in again.";
                return RedirectToAction("Index", "LogIn");
            }
            return View();
        }

